import styled from "styled-components"

const Footer = styled.div`
    width:100%;
    height:120px;
    color:white;
    background-color:#214142;
    .logos{
        width:30px;
        display:flex;
        flex-direction:row;
        z-index:2;
    }
`
export default Footer
